import './StudentRecordList.scss';
import { TableBody, TableCell, TableRow } from '@material-ui/core';
import useTable from '../useTable';
import {getAllStudentRecords} from '../../services/studentRecordService';
import { useState } from 'react';

function StudentRecordList(props){
    const [records, setRecords] = useState(getAllStudentRecords())
    const {
        tblContainer
    } = useTable();
    return(
        <div>
            <tblContainer>
                <TableBody>
                    {
                        records.map(item => {
                            <TableCell>
                                {item.fullName}
                            </TableCell>
                        })
                    }
                </TableBody>
            </tblContainer>
        </div>
    )
}

export default StudentRecordList;
